package com.sb.bean;

public class MyBean {

	String uid;
	String uname;
	public MyBean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public MyBean(String uid, String uname) {
		super();
		this.uid = uid;
		this.uname = uname;
	}
	public String getUid() {
		return uid;
	}
	public void setUid(String uid) {
		this.uid = uid;
	}
	public String getUname() {
		return uname;
	}
	public void setUname(String uname) {
		this.uname = uname;
	}
	
	
}
